import React from "react";

class Sidebar extends React.Component {
  render() {
    return (
      <div className={`sidebar ${this.props.visible ? 'visible' : ''}`}>
        {this.props.checkboxes.map((number) => (
          <label key={number}>
            <input type="checkbox" value={number} />
            Route {number}
          </label>
        ))}
      </div>
    );
  }
}

export default Sidebar;
